ations are always welcome at <span on-click-select-all>0xa3acb4270415692cc4532a129534048364dcb1b2</span>.</p>\n\n  <p>Finally, you might have noticed that there is no entropy generation step as there is at websites like <a href="https://bitaddress.org/">BitAddress.org</a>. This website relies on the cryptographically strong <a href="https://developer.mozilla.org/en-US/docs/Web/API/RandomSource/getRandomValues">window.crypto.getRandomValues</a> function available in modern browsers, which harvests entropy from your OS\'s entropy pool. If you have reason to believe that this is insecure and are willing to school me on the subject, <a href="https://github.com/ryepdx/ethaddress.org/issues">open an issue</a> and we\'ll talk it out.</p>\n</div>\n',brainWallet:'<div class="row screen-only">\n  <div class="row">\n    <div class="col s12">\n      <div class="card-panel red">\n        <span class="white-text"><b>WARNING:</b> Brain wallets are only as safe as the phrases you use to generate them. If you generate a seven word phrase using  <a href="https://en.wikipedia.org/wiki/Diceware" class="red-text text-lighten-4" target="_blank">diceware</a>, you\'ll probably be fine. If you use a line from Dostoevsky, or from an obscure poem, or from anything else that has <b>ever</b> (or <b>might</b> have ever) been rendered in print, though, <a href="http://www.palkeo.com/code/stealing-bitcoin.html" class="red-text text-lighten-4" target="blank">you\'re going to have a bad time</a>. <a href="http://world.std.com/~reinhold/diceware.html" class="red-text text-lighten-4">Arnold Reinhold\'s website</a> contains detailed information in multiple languages on how to generate secure diceware-based passphrases.</span>\n      </div>\n    </div>\n  </div>\n  <div class="row">\n    <div class="col s12">\n      <select class="input-field" ng-model="algorithm" ng-init="algorithm=\'scrypt\'" material-select>\n        <option value="scrypt">Scrypt</option>\n        <option value="sha3">SHA3 (legacy, U
